import React from 'react'

export const Heading = ({ headingType, text }) => {
  const renderHeading = () => {
    switch (headingType) {
      case 'h1':
        return (<h1>{text}</h1>)
        break;

        default:
          return (<h1>{text}</h1>)

    }
  }
  return <h1>{text}</h1>
}
